import { React, useState } from "react";
import { Router, Route, BrowserRouter, Routes } from "react-router-dom";
import Landing from "./pages/Landing";

function App() {
  const [theme, setTheme] = useState("fantasy");
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Landing />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
